import Box from "@mui/material/Box";
import Modal from "@mui/material/Modal";

import { ContainerModal } from "./style";

export default function WeeklyModal({ open, handleClose, weeklyFeed }) {
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box>
        <ContainerModal>
          <section className="contentModal">
            <button onClick={handleClose} className="btnClose">
              X
            </button>
            <div>
              <div>
                <h1 className="titlePopUp">conte√∫do da semana</h1>
                <p className="textPopUp">{weeklyFeed?.title}</p>
              </div>
            </div>
          </section>
        </ContainerModal>
      </Box>
    </Modal>
  );
}
